import React, { useState, useEffect } from 'react';

function App() {
    const [stocks, setStocks] = useState([]);

    useEffect(() => {
        fetch('/api/stocks')
        .then(response => {
            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }
            return response.json();
        })
        .then(data => {
                const orderedData = data.map(stock => ([
                    ['ticker', stock.ticker],
                    ['open', stock.open],
                    ['high', stock.high],
                    ['low', stock.low],
                    ['volume', stock.volume],
                    ['latest_close', stock.latest_close],
                    ['change', stock.change],
                    ['change_percent', stock.change_percent],
                ]));
                setStocks(orderedData);
            })
            .catch(error => console.error('Error:', error));
    }, []);

    return (
        <div>
            {stocks.map((stock, index) => (
            <div key={index}>
                <h2>{stock[0][1]}</h2>
                <p>Open Price: {stock[1][1]}</p>
                <p>High Price: {stock[2][1]}</p>
                <p>Low Price: {stock[3][1]}</p>
                <p>Volume: {stock[4][1]}</p>
                <p>Latest Close: {stock[5][1]}</p>
                <p>Change: {stock[6][1]}</p>
                <p>Change Percent: {stock[7][1]}</p>
            </div>
            ))}
        </div>
    );
}

export default App;
